import React from 'react';
import data from './a.json';
var element=data;
class All extends React.Component{
    constructor(){
        super()
        this.state={
            arr:[]
        }
    }
    componentDidMount()
    {
        element.map((e)=>
            {
                this.setState({arr:e})
            })
    }

    render()
    {
        return(

            this.state.arr.map((e)=>
            (
                <ui>
                    <li><a href=''>{e.title}</a></li>

                </ui>
            )
            )
            )

    }
}
export default All;
